import React, { useState } from 'react';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import { Container, CssBaseline } from '@mui/material';
import ChatInterface from './components/ChatInterface';
import Header from './components/Header';
import ResponseDisplay from './components/ResponseDisplay';

const theme = createTheme({
  palette: {
    primary: { main: '#2196f3' },
    secondary: { main: '#f50057' },
    background: { default: '#f5f5f5' },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
  },
});

function App() {
  const [messages, setMessages] = useState([]);
  const [loading, setLoading] = useState(false);
  const [currentResponse, setCurrentResponse] = useState(null);

  const extractAgentMessages = (msg) => {
    if (typeof msg.message === 'string') {
      return [msg.message];
    }

    const messages = [];
    const message = msg.message;

    if (message.initial_search?.message) {
      messages.push({
        content: message.initial_search.message,
        type: 'search'
      });

      // Add property list if available
      if (message.initial_search.properties) {
        const propertyList = message.initial_search.properties
          .map(p => `üè† ${p.name}\n${p.description}\nPrice: ${p.price}`)
          .join('\n\n');
        messages.push({
          content: propertyList,
          type: 'properties'
        });
      }
    }

    if (message.analysis?.message) {
      messages.push({
        content: message.analysis.message,
        type: 'analysis'
      });

      // Add rejected properties if available
      if (message.analysis.rejected_properties) {
        const rejections = message.analysis.rejected_properties
          .map(p => `‚ùå ${p.name}: ${p.reason}`)
          .join('\n');
        messages.push({
          content: rejections,
          type: 'rejections'
        });
      }
    }

    if (message.strategy?.message) {
      messages.push({
        content: message.strategy.message,
        type: 'strategy'
      });
    }

    if (message.final_recommendations?.message) {
      messages.push({
        content: message.final_recommendations.message,
        type: 'recommendations'
      });

      // Add final property recommendations if available
      if (message.final_recommendations.properties) {
        const finalProperties = message.final_recommendations.properties
          .map(p => `‚ú® ${p.name}\n${p.highlight}\nPrice: ${p.price}`)
          .join('\n\n');
        messages.push({
          content: finalProperties,
          type: 'final_properties'
        });
      }
    }

    // Handle summary from Sarah
    if (message.summary) {
      messages.push({
        content: message.summary,
        type: 'summary'
      });
    }

    return messages.length > 0
      ? messages
      : [{
          content: '[Processing...]',
          type: 'processing'
        }];
  };

  const handleSendMessage = async (message) => {
    setLoading(true);
    setMessages(prev => [...prev, { type: 'user', content: message }]);

    try {
      const response = await fetch('/chat', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ message }),
      });

      const data = await response.json();
      setCurrentResponse(data);

      if (Array.isArray(data.conversation)) {
        let previousAgent = null;
        
        for (const msg of data.conversation) {
          // Add typing indicator
          setMessages(prev => [...prev, {
            type: 'typing',
            agent: msg.name,
            content: '...',
            emoji: msg.emoji,
            role: msg.role
          }]);

          // Simulate typing time based on message length
          await new Promise(resolve => 
            setTimeout(resolve, Math.min(1000, msg.message.length * 10))
          );

          // Remove typing indicator
          setMessages(prev => prev.filter(m => m.type !== 'typing'));

          // If it's a new agent speaking, add a transition message
          if (previousAgent && previousAgent !== msg.name) {
            await new Promise(resolve => setTimeout(resolve, 500));
          }

          // Process agent's messages
          const displaySteps = extractAgentMessages(msg);
          
          for (const step of displaySteps) {
            setMessages(prev => [...prev, {
              type: 'agent',
              agent: msg.name,
              content: step.content,
              emoji: msg.emoji,
              role: msg.role,
              messageType: msg.type,
              contentType: step.type
            }]);

            // Add slight delay between multiple messages from same agent
            await new Promise(resolve => setTimeout(resolve, 800));
          }

          previousAgent = msg.name;
        }
      } else {
        setMessages(prev => [...prev, {
          type: 'agent',
          agent: 'Sarah',
          content: 'Sorry, I encountered an error. Please try again.',
          emoji: 'üë±‚Äç‚ôÄÔ∏è',
          role: 'Team Lead',
          messageType: 'error'
        }]);
      }
    } catch (error) {
      console.error('Error:', error);
      setMessages(prev => [...prev, {
        type: 'agent',
        agent: 'Sarah',
        content: 'Sorry, I encountered an error. Please try again.',
        emoji: 'üë±‚Äç‚ôÄÔ∏è',
        messageType: 'error'
      }]);
    } finally {
      setLoading(false);
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Container maxWidth="lg" sx={{ height: '100vh', display: 'flex', flexDirection: 'column', py: 2 }}>
        <Header />
        <ResponseDisplay response={currentResponse} />
        <ChatInterface
          messages={messages}
          onSendMessage={handleSendMessage}
          loading={loading}
        />
      </Container>
    </ThemeProvider>
  );
}

export default App;
